contracts/CertificationContract.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

import "./SupplyChainStructs.sol";

contract CertificationContract{

    mapping(string => SeedCertificationResults) public sc_results;
    mapping(string => Inspection) public inspections;

    function request_inspection(string memory ds_hash) payable public{
        Inspection storage inspection = inspections[ds_hash];
        inspection.application_timestamp = block.timestamp;
    }

    function schedule_inspection(string memory ds_hash, uint appointment_timestamp) payable public{
      inspections[ds_hash].scheduled_inspection_timestamp = appointment_timestamp;
    }

    function seed_certification_results(string memory seed_hash, string memory eval_of_orign, string memory field_inspection, string memory sample_inspection, string memory bulk_inspection, string memory control_plot_testing, string memory grow_out_test)payable public{
      SeedCertificationResults storage results = sc_results[seed_hash];
      results.eval_of_orign = eval_of_orign;
      results.field_inspection = field_inspection;
      results.sample_inspection = sample_inspection;
      results.bulk_inspection = bulk_inspection;
      results.control_plot_testing = control_plot_testing;
      results.grow_out_test = grow_out_test;
    }
}

contracts/SupplyChainStructs.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

struct IoTDevice{
    string mac_address;
    string did_address;
}

//where to store this data that will be done later.
struct Inspection{
    string ds_hash;
    //string inspection_type;
    //string officer_address;

    uint application_timestamp;
    uint scheduled_inspection_timestamp;
    //string certification_agency_address;
}

struct SeedCertificationAgency{
    string lab_name;
    string lab_location;
    string lab_uid;
}

struct SeedCertificationResults{
    string sca_uid;
    string field_inspection;
    string bulk_inspection;
    string eval_of_orign;
    string sample_inspection;
    string control_plot_testing;
    string grow_out_test;
}

struct Seed{
    //crop whose seed it is
    string name;
    //store ipfs hash address of the seed producer details.
    string seed_producer_bc_add; 
}


struct SeedProducer{
    string name;
    string location;
    string blockchain_address;
    //the weighing scales are the iot devices which are present at the seed producer.
    mapping(string => IoTDevice) iot_devices;
}

struct Farm{
    string location;
    uint field_area;
    //here the key is the did address of the iot device...this can be changed to the mac address as well
    //or to any other field
    mapping(string => IoTDevice) iot_devices;}

struct Farmer{
    string blockchain_address;
    string name;
    string location;
    mapping(string => Farm) farms;
}

struct Package{
    //all this is stored in ipfs.
    // uint box_weight;
    // string source_add;
    //I'm thinking adding the logistics vehicle owner address who owns the vehicle.
    uint256 packaging_date;
    uint256 delivery_date;
    string uid;
}

struct Vehicle{
    string owner_bc_add;
    string vehicle_number;
    //this gps device will give the current location of the vehicle.
    IoTDevice iot_device;
}

struct LogisticsCompany{
    string name;
    string head_office_location;
    string owner_blockchain_address;
    mapping(string => Vehicle) vehicles;
}

struct Wholesaler{
    string blockchain_address;
    string name;
    string location;
}

struct Factory{
    string name;
    string location;
    mapping(string => IoTDevice) iot_devices;
}

struct Processor{
    string blockchain_address;
    string name;
    mapping(string => Factory) factories;
}

struct Distributor{
    string blockchain_address;
    string name;
}
struct Retailer{
    string blockchain_address;
    string name;
}

